import React, { Component } from "react";
import "./style.css";

export default class SearchResults extends Component {
    constructor(props) {
        super(props);
        console.log("this is my initializer");

        const movies = [
            { id: 0, title: "movie title1", summary: "movie1 overview" },
            { id: 1, title: "movie title2", summary: "movie2 overview" }
        ]

        const movieRows = [];

        this.state = {
            rows: <p>This is my row</p>
        }

        movies.forEach((movie => {
            console.log(movie.title);

            const movieRow =
                <div className="row">
                    <div className="col-md-3">
                        {/* image will go here */}
                    </div>

                    <div className="col-md-9">
                        {/* movie info will go here */}
                    </div>
                </div>  

            movieRows.push(<p key={movie.id}>{movie.title}</p>)
        }))

        this.state = { rows: movieRows }
    }

    render() {
        return (
            <div>
                {this.state.rows}
            </div>
        );
    }

}
